import React from "react";
import { Link } from "react-router-dom";


function NavBar(){
    return (
        <ul>
            <li><Link to="/">Home </Link></li>
            <li><Link to="/PricePredictions">Price Predictions </Link></li>
            <li><Link to="/GeneratedPredictions">Generated Predictions </Link></li>
        </ul>
    )
}

export default NavBar;
